name:
fun PostItem(navigateToNewsDetail: (String) -> Unit, navigateToReport: (PostListItemData) -> Unit, like: () -> Unit, postListItemData: PostListItemData, modifier: Modifier = Modifier.fillMaxWidth()
      //        .clickable {
      //            navigateToNewsDetail.invoke(postListItemData.Post.Id.toString())
      //        }
      .composed {
        val postDetailViewModel = koinInject<PostDetailViewModel>()
        return@composed this.clickable {
          postDetailViewModel.refreshPostById(postListItemData.Post.Id.toString())
          navigateToNewsDetail.invoke(postListItemData.Post.Id.toString())
        }
      }
      .padding(10.dp)
      .wrapContentHeight()
      .animateContentSize())

